import './App.css';
import {BrowserRouter as Routers, Routes, Route} from 'react-router-dom';
function App() {
  return (
   <>
   <div>
    <Routers>
      <Routes>
        <Route exact path='/'/>
      </Routes>
    </Routers>
   </div>
   </>
  );
}

export default App;
